import React from 'react';
import './List.css';

class ListClass extends React.Component {
  render() {
    return (
      <section className="List">
        <header className="List-header">
          <h2>{this.props.header}</h2>
        </header>
        <div class="List-cards">
          {this.props.cards}
        </div>
      </section>
    )
  }
}

export default ListClass;
